import './Logo.css';

class Logo extends React.Component {
  render() {
    return (
      <svg viewBox="0 0 16 16" class="svg-1">
        <path stroke={props.stroke} d="M1.5 12 h4.5 a 2 2 0 10 4 0 a 2 2 0 10 -4 0 M1.5 12 l3 -10 l3 8 m1 0 l3 -8 l3 10" />
      </svg>
    );
  }
}
